import Form from '../shared-components/form';
import Todo from '../todo';
import './style.css'

function Board() {
    return (
        <div className='board-wrapper'>
            <Todo title="TODO" numberTasks={1} ></Todo>
            <Todo title="IN PROGRESS" numberTasks={1}>  </Todo>
            <Todo title="DONE" numberTasks={1}> </Todo>
        </div>
    )
}

export default Board;
